records.addlTxt:
Defendant Rebekkah H Webb in court with attorney Douglas M Bihler.  Thomas L Potter and Paul Dedinsky appeared for the State of Wisconsin.

AS TO COUNT 1:  DISMISSED.

AS TO COUNT 2, Defendant changes plea to GUILTY. Defendant examined as to her plea, advised of her Constitutional rights and the maximum penalty. Court found that defendant freely, voluntarily and intelligently waived her rights. Plea questionnaire received and filed. Parties stipulate to the complaint as a factual basis to sustain defendant's plea. Court found defendant guilty as charged in the information and ordered a Judgment of Conviction be entered on the record. Defendant is advised she is a convicted felon and may not possess any firearms. Defendant is advised she is unable to vote in any election until civil rights are restored. Defendant further advised that if she is not a US citizen deportation is possible.  

Court withheld sentence, but granted defendant ZERO credit for  time served in the event that sentence is imposed at a later date.  Court placed defendant on probation for 3 YEARS with the following conditions:
-
Defendant ORDERED to serve 90 DAYS of CONDITION TIME at House of Correction under HOME DETENTION with HUBER RELEASE for Treatment, Doctor's Appointment for either herself or her child, Court Appearances, Grocery Supermarket/Store, and Pharmacy.  Additional 30 DAYS CONDITION TIME ORDERED by the Court to be utilized by Department of Corrections, Probation and Parole at their discretion, if needed.  Defendant REMANDED into the custody of the Milwaukee County Sheriff's Department.
-
CONDITIONS OF PROBATION: 
-AODA assessment and cooperate with any programs deemed necessary by the probation department;
-absolute sobriety, no alcohol, no drugs;
-no possession/consumption/selling/distribution/being in vicinity of illegal drugs/alcohol;
-random urine screens, if deemed appropriate;
-obtain/maintain fulltime employment/education/vocation, as deemed appropriate by agent;
-pay restitution in the amount of $ZERO;
-provide DNA sample;
-pay MANDATORY DNA surcharge;
-pay all court costs, fees, and surcharges; failure to pay shall result in a civil judgment being entered;
-pay all applicable fees of supervision; failure to pay shall result in a civil judgment being entered.
-
-  Court ORDERS Defendant to pay a Fine in the amount of $1,200.00.
-  Court ORDERS Defendant's Driver's License SUSPENDED for a period of 4 YEARS.
-  Court Order for IDP Related Offense Driver Assessment And Driver Safety Plan, SIGNED AND FILED.
-
-  Payment Plan for all monetary obligations to be established by Department of Corrections, Probation and Parole.  All unpaid balances at the end of the probationary period will convert to a civil judgment.
-  Firearm/Voting Rights/Civil Judgment Warning given.
-  No Cash Bail Posted in this matter.  

Appeal rights given. Notice of Right to Seek Postconviction Relief received and filed. Copy given to defendant.
